import { Menu } from "lucide-react";

export default function Navbar() {
  return (
    <nav className="bg-gray-900 text-white shadow-md px-6 py-3 flex items-center justify-between">
      <div className="flex items-center gap-2">
        <Menu className="w-6 h-6 cursor-pointer" />
        <span className="font-bold text-xl">Doctor APS</span>
      </div>
      <div className="flex gap-6">
        <button className="hover:text-blue-400">Dashboard</button>
        <button className="hover:text-blue-400">Profile</button>
        <button className="hover:text-blue-400">Logout</button>
      </div>
    </nav>
  );
}
